import React, { Component } from 'react'
import TrainerService from '../services/TrainerService'

export default class ViewTrainer extends Component {
    constructor(props)
    {
        super(props)

        this.state = {
            trainer : {}
        }
    }

    componentDidMount(){
        TrainerService.getTrainerById(this.props.router.params.id).then(res=>{
            this.setState({trainer: res.data})
            console.log(trainer);
        })
    }

    render() {
        return (
        <div>ViewTrainer</div>
        )
    }
}
